import React from 'react'
import"./About.css"
import"./cc.jpg"
const index = (props) => {
  return (
    <div className='about-us'>
        <h2>A propos de nous</h2>
        <p>Bienvenus a (props.name) qui est de l'age </p>
        <img src="./cc.jpg" alt="" />
      
    </div>
  )
}
export default index
